import React, { useState } from "react";

import MoviesList from "./components/MoviesList";
import "./App.css";

function App() {
  const [movies, setMovies] = useState([]);

  const fetchMoviHandler = () => {
    console.log("aseas");
    fetch("https://swapi.dev/api/films/")
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        console.log(data.results);
        const movieList = data.results.map((movieItem) => {
          return {
            id: movieItem.episode_id,
            title: movieItem.title,
            openingText: movieItem.opening_crawl,
            releaseDate: movieItem.release_date,
          };
        });
        setMovies(movieList);
      });
  };

  return (
    <React.Fragment>
      <section>
        <button onClick={fetchMoviHandler}>Fetch Movies</button>
      </section>
      <section>
        <MoviesList movies={movies} />
      </section>
    </React.Fragment>
  );
}

export default App;
